import useState from 'react';
import Submenu from './SubMenu';
const [setter,setYou] = useState(false);

function giver(){
  setYou(true);
}
function Navop (props) {

    return(
        <div onMouseEnter={giver} className=" flex py-3 rounded-sm text-white font-integral text-xs transition-all duration-300 hover:text-black hover:bg-white">
      {props.name}
    if(setter){<SubMenu/>}
        </div>
    );
    }
     export default Navop;
